    let randomSeed = Date.now();
    let parseData = new ParseData(facebookData, randomSeed);
    it("Get the first name of the user", () => {
        let firstName = parseData.getMyFirstName()
        expect(firstName).toEqual("Vivek");
    })
    it("Get the gender of the user", () => {
        let gender = parseData.getMyGender()
        expect(gender).toEqual("male");
    })
    it("Get the email address of the user", () => {
        let email = parseData.getMyEmailAddress()
        expect(email).toEqual("vivekfitkariwala@gmail.com");
    })
    it("Get my full name", () => {
        let fullName = parseData.getMyFullName();
        expect(fullName).toEqual("Vivek Fitkariwala");
    })
    it("Get my profile picture", ()=>{
            let profilePicture = parseData.getMyProfilePicture();
            console.log(profilePicture);
            expect(profilePicture).toContain("https://graph.facebook.com/me/picture?width=100&heigh=100");
        
    })
    it("Get the profile picture of the user", () => {
        parseData.makeConnections().then(() => {
            let friendsArray = parseData.getFriendsArray();
            expect(friendsArray.length).toEqual(10);
            
            _.forEach(friendsArray, (value, key)=>{
                expect(typeof value.first_name).toBe('string');
                expect(typeof value.last_name).toBe('string');
                expect(typeof value.gender).toBe('string');
                expect(typeof value.name).toBe('string');
                expect(typeof value.id).toBe('string');
                expect(typeof value.weight).toBe('number');
            })

            expect(typeof parseData.getFriendFirstName()).toBe('string');
            expect(typeof parseData.getFriendFullName()).toBe('string');
            expect(typeof parseData.getFriendProfilePicture()).toBe('string');
        })

    })
